contracts/Array.sol.content:
// SPDX-License-Identifier: MIT 
// SPDX-License-Indentifier: MIT
pragma solidity ^0.8.0;

contract Arraycontract {
    string public name;
    uint256[] public number;
    uint256[] public number1 = [3, 5, 2];

    constructor (string memory _name) {
        name = _name;
    }

    function Arraypush (uint256 num) public {
        number.push(num);
    }

    function Arraypop () public {
        number1.pop();
    }

    function Arraylength () public view returns (uint256) {
        return number1.length;
    }

    function Arraydelete(uint256 index) public {
        require(index < number1.length, "index out of bounds");
        delete number1[index];
    }
}

contracts/Bytes.sol.content:
// SPDX-License-Identifier: MIT 
// SPDX-License-Indentifier: MIT
pragma solidity ^0.8.0;

contract Bytescontract {


    function getLength (bytes memory data) public pure returns (uint) {
        return data.length;
    }

    function bytesAccess (bytes memory data, uint256 index)public pure returns (bytes1) {
        require(index < data.length, "index out of bounds");
        return data[index];
    }

}

contracts/Mapping.sol.content:
// SPDX-License-Identifier: MIT 
// SPDX-License-Indentifier: MIT
pragma solidity ^0.8.0;

contract Mappingcontract {
    mapping(address => uint256) public balance;

    function setBalance(address user, uint256 amount) public {
        balance[user] = amount;
    }

    function getBalance(address user) public view returns (uint256) {
        return balance[user];
    }
}

contracts/Struct.sol.content:
// SPDX-License-Identifier: MIT 
// SPDX-License-Indentifier: MIT
pragma solidity ^0.8.0;

contract Structcontract {
    struct User {
        string name;
        uint256 age;
        uint256 balance;
    }

    User public user;

    function setUser(string memory _name, uint256 _age, uint256 _balance) public { //이름, 나이, 값 저장
        user = User(_name, _age, _balance);
    }

    function updatebalance(uint256 _newbalance) public { // 값 수정
        user.balance = _newbalance;
    }

    function deleteUser() public { //struct 안의 전체 초기화
        delete user;
    }

    function deletebalance() public { //특정 변수만 초기화
        delete user.balance;
    }

    function getUser() public view returns (string memory, uint256, uint256) { //이름, 나이 ,값 조회
        return (user.name, user.age, user.balance);
    }


}

